      console.log(<div />);
      console.log(typeof <div />);
      div = <div />;
      div.appendChild(renderer.domElement);
    }

    function animate() {
      requestAnimationFrame(animate);

      mesh.rotation.x += 0.01;
      mesh.rotation.y += 0.02;

      renderer.render(scene, camera);
    }
  }

  render() {
    console.log(renderer.domElement);
    return div;
  }
}

export default App;
